Files taken from three DVDs made from the Cryptome archive.  15 years of documents from June 1996 to May 2011. 

The archive contains about 65,000 files (~10 GiB) published on Cryptome.org, its related sites and US Army INSCOM Dossiers of about 24,000 pages.


Though this Archive appears to be legitimate, it is Unverified.  A VERIFIED copy of the Archive, 1996-2012, will be posted after the New Year.
